import React from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from "reactstrap";

import Home from "./Home";

export default class NavBar extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false,
      visible: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    const buttonText = this.state.visible ? "Log Out" : "Sign In";
    return (
      <div>
        <Navbar color="primary" light expand="xl">
          <NavbarBrand className="text-white" href="/">
            <img
              width="300"
              height="100"
              src={require("../images/logo1.png")}
            />
          </NavbarBrand>
          <font align="center" color="yellow" size="6">
            <strong>
              Welcome to the Start Smart Student and Instructor Information
              System
            </strong>
          </font>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <font size="4">
                  <NavLink className="text-white" href="/components/">
                    About
                  </NavLink>
                </font>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle className="text-white" nav caret>
                  <font size="4">Account</font>
                </DropdownToggle>
                <DropdownMenu right>
                  <font size="4">
                    <DropdownItem>Task 1</DropdownItem>
                    <DropdownItem>Task 2</DropdownItem>
                    <DropdownItem divider />
                    <DropdownItem>Notifications</DropdownItem>
                  </font>
                </DropdownMenu>
              </UncontrolledDropdown>
              <NavItem>
                <font size="4">
                  <NavLink className="text-white" href="/components/">
                    Sign Up
                  </NavLink>
                </font>
              </NavItem>

              {this.state.visible ? <Home /> : <div>Not Authenticated ! </div>}
              <button
                onClick={() => {
                  this.setState({ visible: !this.state.visible });
                }}
              >
                {buttonText}
              </button>

              <NavItem>
                <font size="4">
                  <NavLink className="text-white" href="/components/">
                    Sign In
                  </NavLink>
                </font>
              </NavItem>
            </Nav>
          </Collapse>
        </Navbar>
      </div>
    );
  }
}
